window.loginFormSetup = loginFormSetup;

function loginFormSetup(formContainer) {

    $(formContainer + ' .login-button').click(function (e) {
        e.preventDefault();
        if (!$('.loader-wrapper').length) {
            // console.log('adding loading animation to dom');
            var loader = $('<div class="loader-wrapper visible"><div class="loader"><div></div><div></div><div></div></div></div>');
            loader.appendTo('body');
        } else {
            $('.loader-wrapper').addClass('visible');
        }
        loginFormCheckEmail(formContainer);
    });

    $(formContainer + ' .forgot-pass').click(function () {
        loginFormForgotPassword(formContainer);
    });

    $(formContainer + ' input[name=userid], ' + formContainer + ' input[name=password]').on('keyup blur', function () {

        if ($(this).parsley().isValid()) {

            if ($(formContainer + ' input[name=password]').is(':hidden')) {
                // if password isn't showing, then user is valid, enable the button
                $(formContainer + ' .login-button').prop('disabled', false);
            } else if ($(formContainer + ' form').parsley().isValid()) {
                // if password is showing, then check whole form
                $(formContainer + ' .login-button').prop('disabled', false);
            } else {
                $(formContainer + ' .login-button').prop('disabled', true);
            }
        } else {
            $(formContainer + ' .login-button').prop('disabled', true);
        }
        if (!$(formContainer + ' input[name=userid]').parsley().isValid()) {
            $(formContainer + ' input[name=password]').val('');
        }

        if ($(this).attr('name') === 'userid') {
            var val = $(this).val();
            if ($(this).data('last') != val) {
                $(formContainer + ' .password').slideUp(500);
            }

            $(this).data('last', val);
        }
    });

    if (userPermissions.permissions.canRememberMe) {
        $(formContainer + ' .remember').show();
    }
}

window.loginFormCheckEmail = loginFormCheckEmail;
window.emailChecked = null;

function loginFormCheckEmail(formContainer, callback) {
    // console.log('Checking login form email on', formContainer, '...', $(formContainer + ' input[name=userid]').val());
    // Get userid value from form
    var emailField = {
        'email': $(formContainer + ' input[name=userid]').val()
    };

    // console.log('loginFormCheckEmail() called', emailField);
    if (emailField.email === '') {
        $('.loader-wrapper').removeClass('visible');
        return false;
    }

    // make sure we haven't already checked this email
    if ($(formContainer + ' input[name=password]').val() !== '' && $(formContainer + ' .password').is(':visible') && $(formContainer + ' input[name=userid]').val() === window.emailChecked) {
        loginFormSubmit(formContainer);
        return false;
    }

    // Pass email OR Club Carlson InfoD number to endpoint
    $.ajax({
        url: '/ajax/check-email',
        type: 'POST',
        data: emailField,
        dataType: 'json',
        encode: true,
        success: function success(response) {
            var postData;
            if (response.data.error) {
                $('.loader-wrapper').removeClass('visible');
            } else if (response.data.record === "Account exists, proceed to password screen") {
                // account exists, show password field
                if ($(formContainer + ' input[name=password]').val() !== '' && $(formContainer + ' .password').is(':visible')) {
                    loginFormSubmit(formContainer);
                } else {
                    $('.loader-wrapper').removeClass('visible');
                    $('.login-form .password').slideDown(500);
                }
                window.emailChecked = $(formContainer + ' input[name=userid]').val();

                return false;

                // account exists but isn't activated, go to activate screen
            } else if (response.data.record === "Account exists, proceed to activation screen") {

                var url = KEY_PAGES['activate'][LANG];
                var activateForm = $('<form />', { action: url, method: 'POST' });

                postData = {
                    userId: $(formContainer + ' input[name=userid]').val()
                };

                for (var i in postData) {
                    activateForm.append($('<input />', { name: i, type: 'hidden', value: postData[i] }));
                }

                $('body').append(activateForm);
                activateForm.submit();

                return false;

                // account does not exist, go to sign up screen
            } else {
                // console.log("Account doesn't exists.");

                var joinUrl = KEY_PAGES['signup'][LANG];
                var joinForm = $('<form />', { action: joinUrl, method: 'POST' });
                postData = {
                    userid: $(formContainer + ' input[name=userid]').val()
                };
                if ($('#memberType').val() !== "") {
                    postData.memberType = $('#memberType').val();
                }

                for (var postName in postData) {
                    joinForm.append($('<input />', { name: postName, type: 'hidden', value: postData[postName] }));
                }
                $('body').append(joinForm);
                joinForm.submit();
                return false;
            }
        }
    });
}

window.loginFormSubmit = loginFormSubmit;

