  $('body').on('click', 'a[href^="http"]', function (e) {
    e.preventDefault();
    var url = this.href;
    var domain = '.' + getDomain(url);
    var target = this.getAttribute('target');
    if (window.offPlatformBrands.includes(domain)) {
      if (target == '_blank') {
        $.ajax({
          url: '/ajax/set-cross-site-login?target=' + url,
          type: 'POST'
        });
        $.ajax({
          url: '/ajax/get-cross-site-login',
          type: 'POST',
          dataType: 'json',
          success: function success(response) {
            // console.log(response);
            if (response.data.hasOwnProperty('target')) {
              window.open(response.data.target, '_blank');
            } else {
              window.open(url, '_blank');
            }
          }
        });
      } else {
        window.location.href = url;
      }
    }
  });
