//This is for Menus, we style them when they load or when the screen resizes:
window.styleOverlay = styleOverlay;
function styleOverlay() {
  var mh,
      wh,
      lbh,
      hh = 0,
      thislb = $('.livebox:visible'); //get current and visible livebox

  //set the top and height of the livebox:
  //min height for livebox?
  mh = parseInt($('#main').height());
  //hh = parseInt($('header').outerHeight(true));
  if (Foundation.MediaQuery.atLeast('large') && $('.searchwrapper').hasClass('fixed') == false) hh += $(".searchwrapper").outerHeight(true);
  /*if($('.breadcrumb').length > 0)
    hh += parseInt($('.breadcrumb').outerHeight(true));
  else*/if ($('.blog-breadcrumb').length > 0) hh += parseInt($('.blog-breadcrumb').outerHeight(true));
  wh = parseInt($(window).height()) - hh;
  lbh = mh > wh ? wh : mh;
  if (Foundation.MediaQuery.atLeast('medium')) {
    // $('.wrapper').css({
    //   'padding-top': hh + 'px',
    //   'transition': 'padding-top 0.7s cubic-bezier(.35, 0, 0, 1)'
    //  });
    if ($(thislb).length > 0) $(thislb).css({ 'top': hh + 'px',
      'height': lbh + "px" });
  } else {
    if ($(thislb).length > 0) {
      if ($(thislb).hasClass('livebox-full')) $(thislb).css({ 'top': '',
        'height': '' });else $(thislb).css({ 'top': hh + 'px',
        'height': lbh + "px" });
    }
  }

  //no livebox? no use to keep going, really.
  if ($(thislb).length == 0) return;

  //no scroll for you
  $('body').addClass('no-scroll');

  //resize the overlay, if exists:
  var overlay = $(thislb).find('.overlay');
  if (overlay.length > 0) {
    wh = $(window).innerHeight();

    var h1 = hh;
    var h2 = $(thislb).find('.menu_header').outerHeight(true);
    var h3 = 120;
    var oh = wh - (h1 + h2 + h3);
    $(overlay).css({ 'min-height': oh + 'px' });

    //object / embeded elements as well:
    var embobj = $(overlay).find('object');
    if (embobj.length > 0) {
      $(embobj).attr('height', oh);
    }

    var embemb = $(overlay).find('embed');
    if (embemb.length > 0) {
      $(embemb).attr('height', oh);
    }
  }

  $('object.svg').on('load', function () {
    //color SVGs:
    colorSVGs();
  });
}

