//  Select a tab:
window.openTab = openTab;
function openTab(tabId) {
  //current tab-title:
  var tab = $('li#' + tabId + ' a');

  //unselect all tab-titles first:
  $(tab).parents('.tabs').find('.tabs-title a').removeAttr('aria-selected');

  //re-select current tab-title:
  $(tab).attr('aria-selected', 'true');

  //Work with tab-panels:
  var tabs_id = $(tab).parents('.tabs').attr('id'),
      tabs_container = $('.tabs-content');
  $(tabs_container).each(function (index, element) {
    if ($(element).data('tabs-content') == tabs_id) {
      $(element).children('.tabs-panel').hide(); //unselect other tab-panels in the group
      $('.tabs-panel#' + tabId).show(); //re-select current tab-panel
      restProportions();
      styleCTAs();
    }
  });
}

var fgMbMn = false; //flag for mobile menus
//Mobile menus:
window.toggleMobileMenu = toggleMobileMenu;
function toggleMobileMenu(mnGrp, mnItem, setToArg) {
  var setTo;
  if (setToArg == undefined) setTo = !fgMbMn;else setTo = setToArg;

  if (Foundation.MediaQuery.current == 'small') {
    if (setTo) {
      //menu is hidden. Let's show it:
      $(mnGrp).find('li').show();
      $(mnGrp).find('.info-expander').hide();
    } else {
      //menu is shown. Let's hide it:
      $(mnGrp).find('li').hide().removeClass('is-active');
      $(mnGrp).find('li a').removeAttr('aria-selected');
      $(mnItem).show().addClass('is-active');
      $(mnItem).find('a').attr('aria-selected', 'true');
      $(mnItem).find('.info-expander').show();
    }
    fgMbMn = setTo;
  }
}

window.restProportions = restProportions;
function restProportions() {
  //Restrain proportions to image containers:
  if ($('.restprop').length > 0) {
    $('.restprop').each(function () {
      var cw = parseInt($(this).width());
      var prop = $(this).data('proportions').split(':');
      var ch = cw * prop[1] / prop[0];
      $(this).height(ch + 'px');
    });
  }
}

window.colorSVGs = colorSVGs;
function colorSVGs() {
  if ($('object.svg:not(.filled)').length > 0) {
    var pcolor = $('.cta-1').first().css('background-color'); // <- primary color
    //fill with primary color all the SVG parts:
    $('object.svg').each(function () {
      var csvn = $(this)[0].contentDocument;
      if (csvn != null) {
        $(csvn).find('path, line, circle, polyline, polygon').each(function () {
          if ($(this).css('fill') != 'none') $(this).css({ 'fill': pcolor });else $(this).css({ 'stroke': pcolor });
        });
        $(this).addClass('filled');
      }
    });
  }
}

