var videoEmbed = function videoEmbed(options) {
  var defaults = {
    url: '',
    autoplay: 0
  },
      settings = $.extend({}, defaults, options),
      parsed = parseVideoUrl(settings.url),
      id = parsed[0],
      provider = parsed[1],
      embed = '';

  switch (provider) {
    case 'vimeo':
      embed = '<iframe src="https://player.vimeo.com/video/' + id + '?title=0&amp;byline=0&amp;portrait=0&amp;autoplay=' + settings.autoplay + '" width="100%" height="410" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>';
      break;

    default:
      embed = '<iframe width="100%" height="410" src="https://www.youtube.com/embed/' + id + '?rel=0&amp;showinfo=0&amp;autoplay=' + settings.autoplay + '" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>';
      break;
  }

  return embed;
};

var parseVideoUrl = function parseVideoUrl(url) {
  var th = this,
      match = url.match(/(?:(?:https?:)?\/\/)?(?:[^\.]+\.)?(\w+)\./i),
      provider = match ? match[1] : undefined,
      result,
      regExp = '';

  switch (match[1]) {
    case 'youtube':
      regExp = /https?:\/\/(?:[a-zA_Z]{2,3}.)?(?:youtube\.com\/watch\?)((?:[\w\d\-\_\=]+&amp;(?:amp;)?)*v(?:&lt;[A-Z]+&gt;)?=([0-9a-zA-Z\-\_]+))/i;
      break;

    case 'vimeo':
      regExp = /https?:\/\/(?:www\.)?(vimeo\.com)\/(?:hd#)?([0-9]+)/i;
      break;
  }

  match = url.match(regExp);

  if (match && match[2].length > 1) {
    return [match[2], provider];
  } else {
    return false;
  }
};

