window.OfferSticky = OfferSticky;
function OfferSticky() {
  //If we don't have a sticky block, all this is pointless:
  if ($('.offer-title').length == 0) return;

  //setup / restart to initial status
  if (typeof OffScene !== 'undefined' && OffScene !== null) {
    OffScene.destroy(true);
    OffScene = null;
  }
  $('.offer').css({ 'height': '' });
  if ($(window).width() > 640) {
    //Get & set blocks heights:
    var oh = parseInt($('.offer').height()),
        oth = parseInt($('.offer-title').outerHeight(false)),
        os = parseInt($('.offer-sticky-trigger').css('top')),
        hh = parseInt($('header').outerHeight(false)),
        minlh = oth + os + 11;
    if (oh < minlh) {
      $('.offer').height(minlh + 'px');
      oh = minlh;
    } else {
      $('.offer-sticky-wrapper').height(oh + 'px');
      var otd = oh - (oth + os + 1);

      //Start Sticky fx
      OffScene = new ScrollMagic.Scene({ triggerElement: ".offer-sticky-trigger", duration: otd, triggerHook: 0, offset: -hh, reverse: true }).setPin(".offer-title").addTo(OffCtrl);
    }
  }
}

