window.filterFilters = filterFilters;
function filterFilters() {
  //If offerLocations aren't ready yet, we get out:
  if (undefined === (typeof offerLocations === 'undefined' ? 'undefined' : _typeof(offerLocations))) return false;

  //if we don't have filters for location narrowing, we just get out:
  if ($('select[name=os-region]').length == 0) return false;

  if ($('select[name=os-region] option').length == 1) {
    $('select[name=os-region]').html('');
    var isAnySel = false;
    for (region in offerLocations) {
      var regOpt = '<option data-id="' + region + '"';
      if (Object.keys(offerLocations).length == 1) {
        regOpt += ' selected="selected"';
        isAnySel = true;
      }
      regOpt += ' "' + offerLocations[region].fullname + '">' + offerLocations[region].fullname + '</option>';
      $('select[name=os-region]').append(regOpt);
    }
    var aro = '<option value=""';
    if (isAnySel == false) aro += ' selected="selected"';
    aro += '>All Regions</option>';
    $('select[name=os-region]').prepend(aro);
    sortSelect('select[name=os-region]', true);
  }

  var region = $('select[name=os-region]').val(),
      country = $('select[name=os-country]').val(),
      state = $('select[name=os-state]').val(),
      city = $('select[name=os-city]').val();
  narrowCountries(region, country);
  narrowStates(region, country, state);
  narrowCities(region, country, state, city);
}

